import menu from "../icons/menu.svg";
import cart from "../icons/cart.svg";
import { Outlet, Link } from "react-router-dom";

function Navbar() {
    return (
        <div className="Navbar">
            <img src={menu}/>
            <input type='text'></input>
            <Link to="/cart"><img src={cart}/></Link>
            <Outlet/>
        </div>
    );
}

export default Navbar;
